   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_3" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_8", t1."Leaf_9", t1."Leaf_10", t1."Leaf_11", t1."Leaf_12", t1."Leaf_17", t1."Leaf_18", t1."Leaf_19", t1."Leaf_20", t1."Leaf_21", t1."Leaf_27", t1."Leaf_28", t1."Leaf_30", t1."Leaf_32", t1."Leaf_34", t1."Leaf_35", t1."Leaf_36", t1."Leaf_39", t1."Leaf_41", t1."Leaf_42", t1."Leaf_44", t1."Leaf_45", t1."Leaf_46", t1."Leaf_48", t1."Leaf_51", t1."Leaf_53", t1."Leaf_57", t1."Leaf_60", t1."Leaf_61", t1."Leaf_62", t1."Leaf_65", t1."Leaf_67", t1."Leaf_68", t1."Leaf_69", t1."Leaf_71", t1."Leaf_72", t1."Leaf_75", t1."Leaf_78", t1."Leaf_80", t1."Leaf_82", t1."Leaf_84", t1."Leaf_85", t1."Leaf_86", t1."Leaf_91", t1."Leaf_93", t1."Leaf_94", t1."Leaf_97", t1."Leaf_98", t1."Leaf_99", t1."Leaf_101", t1."Leaf_102", t1."Leaf_105", t1."Leaf_107", t1."Leaf_110", t1."Leaf_111", t1."Leaf_112", t1."Leaf_115", t1."Leaf_117", t1."Leaf_119", t1."Leaf_120", t1."Leaf_122", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
