   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_14" AS t1
   LEFT OUTER JOIN
   "DT_node_data_14" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_15" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_4", t1."Leaf_5", t1."Leaf_6", t1."Leaf_14", t1."Leaf_18", t1."Leaf_19", t1."Leaf_21", t1."Leaf_22", t1."Leaf_25", t1."Leaf_26", t1."Leaf_29", t1."Leaf_30", t1."Leaf_31", t1."Leaf_33", t1."Leaf_34", t1."Leaf_35", t1."Leaf_37", t1."Leaf_38", t1."Leaf_40", t1."Leaf_43", t1."Leaf_44", t1."Leaf_49", t1."Leaf_50", t1."Leaf_55", t1."Leaf_56", t1."Leaf_57", t1."Leaf_58", t1."Leaf_60", t1."Leaf_61", t1."Leaf_66", t1."Leaf_67", t1."Leaf_68", t1."Leaf_69", t1."Leaf_70", t1."Leaf_73", t1."Leaf_74", t1."Leaf_77", t1."Leaf_78", t1."Leaf_83", t1."Leaf_84", t1."Leaf_85", t1."Leaf_87", t1."Leaf_88", t1."Leaf_91", t1."Leaf_93", t1."Leaf_95", t1."Leaf_96", t1."Leaf_97", t1."Leaf_101", t1."Leaf_102", t1."Leaf_103", t1."Leaf_104", t1."Leaf_106", t1."Leaf_109", t1."Leaf_110", t1."Leaf_114", t1."Leaf_115", t1."Leaf_116", t1."Leaf_118", t1."Leaf_121", t1."Leaf_123", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    model_input t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_0" > 2.772720) AND (t."X_9" > 1.429567)) THEN 4 ELSE NULL END AS Leaf_4,
      CASE WHEN((t."X_0" > 2.772720) AND (t."X_9" <= 1.429567) AND (t."X_8" <= 0.407123)) THEN 5 ELSE NULL END AS Leaf_5,
      CASE WHEN((t."X_0" > 2.772720) AND (t."X_9" <= 1.429567) AND (t."X_8" > 0.407123)) THEN 6 ELSE NULL END AS Leaf_6,
