    COALESCE( t1."Leaf_4", t1."Leaf_5", t1."Leaf_6", t1."Leaf_11", t1."Leaf_14", t1."Leaf_16", t1."Leaf_17", t1."Leaf_18", t1."Leaf_19", t1."Leaf_21", t1."Leaf_22", t1."Leaf_30", t1."Leaf_31", t1."Leaf_33", t1."Leaf_35", t1."Leaf_36", t1."Leaf_37", t1."Leaf_40", t1."Leaf_41", t1."Leaf_42", t1."Leaf_43", t1."Leaf_49", t1."Leaf_50", t1."Leaf_51", t1."Leaf_52", t1."Leaf_56", t1."Leaf_57", t1."Leaf_58", t1."Leaf_61", t1."Leaf_62", t1."Leaf_66", t1."Leaf_67", t1."Leaf_69", t1."Leaf_70", t1."Leaf_73", t1."Leaf_75", t1."Leaf_76", t1."Leaf_78", t1."Leaf_79", t1."Leaf_80", t1."Leaf_84", t1."Leaf_87", t1."Leaf_88", t1."Leaf_90", t1."Leaf_92", t1."Leaf_98", t1."Leaf_99", t1."Leaf_101", t1."Leaf_102", t1."Leaf_103", t1."Leaf_106", t1."Leaf_107", t1."Leaf_108", t1."Leaf_109", t1."Leaf_110", t1."Leaf_112", t1."Leaf_115", t1."Leaf_117", t1."Leaf_118", t1."Leaf_119", t1."Leaf_123", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
